(5092, 'ArtFromTheHEART!#2', 'Art From The Heart #2<br><b>"Lengvai danguje.Sunkiai zemeje."</b><br><i>Buna, juk, kartais pakeliam galvas ir susimastom...<br>Uz ka mus Auksciausiasis skyre tureti toki beribi dziaugsma...<br>Ar mes to nusipelnem?Mes turime pakankamai izulumo, paziureti Dievui i akis...<br>Jo akivaizdoje net meluoti sugebam.... Dangu as matau, nuostabiu akiu silumoj...<br>Paziuri i jas ir dziaugiesi, kad Dievas vis keicia pavidala..Is vienos materijos, virsta<br>i kita... Pakyla pauksciai i dangu, pakele savo auksinius, bet lengvus sparnus...<br>Paukstis sugeba matyti, tai ko, neisvys joks zmogus...Tikite, ar ne, as ,vistiek, noriu gimti pauksciu<br>ir isskristi toli toli, kur nera pasiputusiu, ir besididziuojanciu savimi zmoniu....<br>As skrisiu...<b> Toli toli, kur busiu suprastas, pauksciai priims mane toki, koks esu...Pauksti...<br>Jusu Eiminas<br></i></b>', '2003-09-08 20:06:13', 'heart2.jpg.jpg', 'heart2.jpg', 2196, 1, 748, 1105, '', 143213),
